/*************************************************************************************
* Este script contiene las selects que generan las órdenes OMBEXPORT a lanzar si se  *
* desea exportar un proyecto OWB objeto a objeto                                     *
**************************************************************************************/

-- Export para locations 
select 'OMBEXPORT TO MDL_FILE ''d:\\OWB_UZA\\' ||
       user || '@UXXIDW@LOCATION@' || A.LOCATION_NAME || '.mdl''' ||
       ' COMPONENTS (LOCATION ''UXXIDW/' || A.LOCATION_NAME || ''') '||
       'OUTPUT LOG TO ''D:\\OWB_UZA\\elog\\' ||
       user || '@UXXIDW@LOCATION@' || A.LOCATION_NAME || '.log'''
from ALL_IV_LOCATIONS A
order by A.LOCATION_NAME

-- Export para conectores
select 'OMBEXPORT TO MDL_FILE ''d:\\OWB_UZA\\' ||
       user || '@' || A.LOCATION_NAME || '@CONNECTOR@' || A.CONNECTOR_NAME || '.mdl''' ||
       ' COMPONENTS (CONNECTOR ''UXXIDW/' || A.LOCATION_NAME || '/' || A.CONNECTOR_NAME || ''') ' ||
       'OUTPUT LOG TO ''D:\\OWB_UZA\\elog\\' ||
       user || '@' || A.LOCATION_NAME || '@CONNECTOR@' || A.CONNECTOR_NAME || '.log'''
from ALL_IV_CONNECTORS A
order by 1

-- Export para procedimientos públicos 
SELECT 'OMBEXPORT TO MDL_FILE ''d:\\OWB_UZA\\' ||
       'PUBLIC' || '@' || SCHEMA_NAME || '@STANDALONEPROCEDURE@' || FUNCTION_NAME || '.mdl''' ||
       ' COMPONENTS (PROCEDURE ''UXXIDW/WB_CUSTOM_TRANS/' || A.FUNCTION_NAME || ''') '||
       'OUTPUT LOG TO ''D:\\OWB_UZA\\elog\\' ||
       'PUBLIC' || '@' || SCHEMA_NAME || '@STANDALONEPROCEDURE@' || FUNCTION_NAME || '.log'''
FROM ALL_IV_FUNCTIONS A
where A.FUNCTION_TYPE = 'Procedure'
and a.SCHEMA_NAME = 'Global-Shared-Library'
order by A.SCHEMA_NAME, A.FUNCTION_NAME

-- Export para flujos
select 'OMBEXPORT TO MDL_FILE ''d:\\OWB_UZA\\' ||
       C.LOCATION_NAME || '@' || B.PACKAGE_NAME || '@PROCESSFLOW@' || A.PROCESS_NAME || '.mdl''' ||
       ' PROJECT ''UXXIDW'' COMPONENTS (PROCESS_FLOW ''' || B.SCHEMA_NAME || '/' || B.PACKAGE_NAME || '/' || A.PROCESS_NAME || ''') ' ||
       'OUTPUT LOG TO ''D:\\OWB_UZA\\elog\\' ||
       C.LOCATION_NAME || '@' || B.PACKAGE_NAME || '@PROCESSFLOW@' || A.PROCESS_NAME || '.log'''
from ALL_IV_PROCESSES A,
     ALL_IV_PACKAGES B,
     ALL_IV_MODULES C
where C.SCHEMA_NAME = B.SCHEMA_NAME
and B.PACKAGE_NAME = A.PACKAGE_NAME
and a.PARENT_PROCESS_ID = 0
order by C.LOCATION_NAME, B.PACKAGE_NAME, A.PROCESS_NAME

-- Export de las secuencias 
select 'OMBEXPORT TO MDL_FILE ''d:\\OWB_UZA\\' ||
       substr(A.SCHEMA_NAME, length(A.SCHEMA_NAME) - 2, length(A.SCHEMA_NAME))
       || '_'
       || substr(A.SCHEMA_NAME, 1, length(A.SCHEMA_NAME) - 4)
       || '@' || A.SCHEMA_NAME || '@SEQUENCE@' || A.SEQUENCE_NAME || '.mdl' ||
       ' PROJECT ''UXXIDW'' COMPONENTS (SEQUENCE ''' || A.SCHEMA_NAME || '/' || A.SEQUENCE_NAME || ''') '||
       'OUTPUT LOG TO ''D:\\OWB_UZA\\elog\\' ||
       substr(A.SCHEMA_NAME, length(A.SCHEMA_NAME) - 2, length(A.SCHEMA_NAME))
       || '_'
       || substr(A.SCHEMA_NAME, 1, length(A.SCHEMA_NAME) - 4)
       || '@' || A.SCHEMA_NAME || '@SEQUENCE@' || A.SEQUENCE_NAME || '.log'''
from ALL_IV_SEQUENCES A
order by A.SCHEMA_NAME, A.SEQUENCE_NAME


-- Export de tablas de sistemas fuente 
select 'OMBEXPORT TO MDL_FILE ''d:\\OWB_UZA\\' ||
       A.SCHEMA_NAME || '@' || A.SCHEMA_NAME || '@TABLE@' || A.TABLE_NAME ||'.mdl''' ||
       ' PROJECT ''UXXIDW'' COMPONENTS (TABLE ''' || A.SCHEMA_NAME || '/' || A.TABLE_NAME || ''') '||
       'OUTPUT LOG TO ''D:\\OWB_UZA\\elog\\' ||
       A.SCHEMA_NAME || '@' || A.SCHEMA_NAME || '@TABLE@' || A.TABLE_NAME ||'.log'''
from ALL_IV_TABLES A
where A.SCHEMA_NAME like '%OLTP'
order by A.SCHEMA_NAME, A.TABLE_NAME

